public static partial class LeetCodeSolutions
{
    private static SegmentTreeNode GetRootFromSpanArray(Span<int> array)
    {
        var queue = new Queue<SegmentTreeNode>(array.Length);

        for (int i = 1; i < array.Length; i++)
        {
            queue.Enqueue(
                new SegmentTreeNode(
                    array[i] - array[i - 1],
                    array[i - 1],
                    array[i]));
        }

        while (queue.Count > 1)
        {
            var first = queue.Dequeue();
            var second = queue.Peek();

            if (first.LastIndex != second.FirstIndex)
            {
                queue.Enqueue(first);
                continue;
            }

            second = queue.Dequeue();

            var parent = new SegmentTreeNode(
                Math.Max(
                    first.MaxBlockSizeInTheTree,
                    second.MaxBlockSizeInTheTree),
                first.FirstIndex,
                second.LastIndex,
                first,
                second);

            first.Parent = parent;
            second.Parent = parent;

            queue.Enqueue(parent);
        }

        return queue.Dequeue();
    }

    private static void DeleteLastSegmentFromTree(SegmentTreeNode root, int maxSize)
    {
        var currentPoint = root;
        while (currentPoint.Right is not null)
        {
            currentPoint.LastIndex = maxSize;
            currentPoint = currentPoint.Right;
        }

        currentPoint.LastIndex = maxSize;
        currentPoint.MaxBlockSizeInTheTree = currentPoint.LastIndex - currentPoint.FirstIndex;

        currentPoint = currentPoint.Parent;

        while (currentPoint is not null)
        {
            currentPoint.MaxBlockSizeInTheTree = Math.Max(
                currentPoint.Right!.MaxBlockSizeInTheTree,
                currentPoint.Left.MaxBlockSizeInTheTree);

            currentPoint = currentPoint.Parent;
        }
    }

    private static SegmentTreeNode TreeRestructureForSegmentDeleting(int newBrickWallIndex, SegmentTreeNode currentPoint)
    {
        var rightSegment = currentPoint.Right;
        var leftSegment = currentPoint.Left;

        // Получаем самые нижние крайние значения
        while (rightSegment?.Left is not null && rightSegment.FirstIndex == newBrickWallIndex)
        {
            rightSegment = rightSegment.Left;
        }

        while (leftSegment?.Right is not null && leftSegment.LastIndex == newBrickWallIndex)
        {
            leftSegment = leftSegment.Right;
        }

        var numberForUpdate = rightSegment.LastIndex;

        while (rightSegment.FirstIndex == newBrickWallIndex)
        {
            rightSegment.FirstIndex = numberForUpdate;
            rightSegment = rightSegment.Parent;

            if (rightSegment == currentPoint && rightSegment.Right.FirstIndex == rightSegment.Right.LastIndex)
            {
                if (rightSegment.Parent is null)
                {
                    rightSegment.Left.Parent = null;
                }
                else
                {
                    bool isRight = rightSegment.Parent.Right == rightSegment;
                    if (isRight)
                    {
                        rightSegment.Parent.Right = rightSegment.Left;
                        rightSegment.Left.Parent = rightSegment.Parent;
                    }
                    else
                    {
                        rightSegment.Parent.Left = rightSegment.Left;
                        rightSegment.Left.Parent = rightSegment.Parent;
                    }
                }
            }
            else if (rightSegment != currentPoint && rightSegment.Left.FirstIndex == rightSegment.Left.LastIndex)
            {
                bool isRight = rightSegment.Parent.Right == rightSegment;
                if (isRight)
                {
                    rightSegment.Parent.Right = rightSegment.Right;
                    rightSegment.Right.Parent = rightSegment.Parent;
                }
                else
                {
                    rightSegment.Parent.Left = rightSegment.Right;
                    rightSegment.Right.Parent = rightSegment.Parent;
                }
            }
            else if (rightSegment.Left is null && rightSegment.Right is null)
            {
                rightSegment.MaxBlockSizeInTheTree = rightSegment.LastIndex - rightSegment.FirstIndex;
            }
            else
            {
                rightSegment.MaxBlockSizeInTheTree = Math.Max(
                    rightSegment.Left.MaxBlockSizeInTheTree,
                    rightSegment.Right.MaxBlockSizeInTheTree);
            }
        }

        var result = leftSegment;
        while (leftSegment is not null)
        {
            if (leftSegment.LastIndex == newBrickWallIndex)
            {
                leftSegment.LastIndex = numberForUpdate;
            }

            if (leftSegment.Left is not null
                && leftSegment.Right is not null)
            {
                leftSegment.MaxBlockSizeInTheTree = Math.Max(
                    leftSegment.Left.MaxBlockSizeInTheTree,
                    leftSegment.Right.MaxBlockSizeInTheTree);
            }
            else
            {
                leftSegment.MaxBlockSizeInTheTree = leftSegment.LastIndex - leftSegment.FirstIndex;
            }

            result = leftSegment;
            leftSegment = leftSegment.Parent;
        }

        return result;
    }

    private static SegmentTreeNode DeleteSegmentFromTree(int newBrickWallIndex, SegmentTreeNode root, int maxSize)
    {
        if (root.LastIndex == newBrickWallIndex)
        {
            DeleteLastSegmentFromTree(root, maxSize);
            return root;
        }

        var currentPoint = root;
        while (currentPoint.Left is not null && currentPoint.Left.LastIndex != newBrickWallIndex)
        {
            if (currentPoint.Left.LastIndex > newBrickWallIndex)
            {
                currentPoint = currentPoint.Left;
                continue;
            }
            currentPoint = currentPoint.Right;
        }

        // Если есть дочерние ноды, то нужно перестроить дерево
        if (currentPoint.Right?.Left is not null || currentPoint.Left?.Right is not null)
        {
            return TreeRestructureForSegmentDeleting(newBrickWallIndex, currentPoint);
        }

        // Если дочерних нод никаких нет, то просто удаляем листья
        currentPoint.Right = null;
        currentPoint.Left = null;
        currentPoint.MaxBlockSizeInTheTree = currentPoint.LastIndex - currentPoint.FirstIndex;

        currentPoint = currentPoint.Parent;

        while (currentPoint is not null)
        {
            currentPoint.MaxBlockSizeInTheTree = Math.Max(
                currentPoint.Right!.MaxBlockSizeInTheTree,
                currentPoint.Left.MaxBlockSizeInTheTree);

            currentPoint = currentPoint.Parent;
        }

        return root;
    }

    public static IList<bool> GetResults(int[][] queries)
    {
        const int startWallsIndex = 1;
        int maxSize = Math.Min(50001, 3 * queries.Length);

        var walls = new int[maxSize];
        walls[0] = 0;

        var wallsIndex = startWallsIndex;
        for (int i = 0; i < queries.Length; i++)
        {
            if (queries[i][0] == 1)
            {
                walls[wallsIndex] = queries[i][1];
                wallsIndex++;
            }
        }

        var result = new bool[queries.Length - wallsIndex + startWallsIndex];
        var resultIndex = result.Length - 1;

        var countOfSegments = wallsIndex - 1;
        if (countOfSegments == 0 || countOfSegments % 2 != 0)
        {
            walls[wallsIndex] = maxSize + 1;
            countOfSegments++;
        }

        var span = walls.AsSpan(0, countOfSegments + 1);
        span.Sort();

        var root = GetRootFromSpanArray(span);

        for (int i = queries.Length - 1; i >= 0; i--)
        {
            if (queries[i][0] == 1)
            {
                root = DeleteSegmentFromTree(queries[i][1], root, maxSize + 1);
                continue;
            }

            var currentNode = root;
            var index = queries[i][1];
            var size = queries[i][2];

            while (true)
            {
                if (currentNode.Left is null)
                {
                    if (currentNode.LastIndex < index)
                    {
                        result[resultIndex] = currentNode.MaxBlockSizeInTheTree >= size || size <= index - currentNode.LastIndex;
                        resultIndex--;

                        break;
                    }

                    result[resultIndex] = size <= index - currentNode.FirstIndex;
                    resultIndex--;

                    break;
                }

                if (currentNode.Left.LastIndex >= index)
                {
                    currentNode = currentNode.Left;
                    continue;
                }

                if (currentNode.Left.MaxBlockSizeInTheTree >= size)
                {
                    result[resultIndex] = true;
                    resultIndex--;

                    break;
                }

                currentNode = currentNode.Right;
            }

        }

        return result;
    }
}

